// Get all incoming items (PDF extractor gives 2)
const items = $input.all();

// Create empty containers
let deathCert = {};
let probateForm = {};

// Loop through items and classify
for (const item of items) {
  const title = item.json.info?.Title || "";

  if (title.includes("DEATH CERTIFICATE")) {
    deathCert = {
      type: "DeathCertificate",
      rawText: item.json.text,
      meta: item.json.info
    };
  } else if (title.includes("Probate Intake Form")) {
    probateForm = {
      type: "ProbateIntake",
      rawText: item.json.text,
      meta: item.json.info
    };
  }
}

// Merge into one output object
const merged = {
  deathCertificate: deathCert,
  probateIntake: probateForm
};

return [
  {
    json: merged
  }
];
